import FocusedDataItem from "./focusedDataItem"

let focusedDataTitle = {
  backgroundColor: "#4382BC",
  textAlign: "center",
}

//Extends Focused
export default function FocusedData({focusedItem}) {
  return (
    <div style={{width: "97%", margin: "12px auto 0px auto", border: "1px solid black", height: "71%"}}>
      <div style={focusedDataTitle}>Profile</div>
      <div style={{position: "absolute", zIndex: 1}}>
        <div style={{position: "absolute", backgroundColor: "white", fontSize: "11px", width: "96.8%", zIndex: -1}}>
          <FocusedDataItem itemObject={focusedItem.resources[0].data}/>
        </div>
      </div>
    </div>
  )
}
